package com.god.yb.testgitdemo.activities;

import android.os.Bundle;
import android.view.View;
import android.widget.Button;
import android.widget.TextView;

import com.alibaba.fastjson.JSONObject;
import com.god.yb.testgitdemo.R;

import java.util.HashMap;

import butterknife.BindView;
import butterknife.ButterKnife;
import butterknife.OnClick;
import okhttp3.RequestBody;
import retrofit2.Call;
import retrofit2.Callback;
import retrofit2.Response;
import retrofit2.Retrofit;
import retrofit2.converter.gson.GsonConverterFactory;
import retrofit2.http.Body;
import retrofit2.http.Field;
import retrofit2.http.FormUrlEncoded;
import retrofit2.http.GET;
import retrofit2.http.Headers;
import retrofit2.http.POST;
import retrofit2.http.Path;

public class NetRertofitActivity extends BaseActivity {

    @BindView(R.id.bt_id_test)
    Button btIdTest;
    @BindView(R.id.tv_result_a)
    TextView tvResultA;
    @BindView(R.id.bt_get_test)
    Button btGetTest;
    @BindView(R.id.tv_result_b)
    TextView tvResultB;
    @BindView(R.id.bt_post_test)
    Button btPostTest;
    @BindView(R.id.tv_result_c)
    TextView tvResultC;

    private String base_url_get = "https://api.github.com/";
    private String base_url_post = "http://fanyi.youdao.com/";
    private String base_url_json = "https://dm-51.data.aliyun.com/";

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_net_rertofit);
        ButterKnife.bind(this);
    }

    @OnClick({R.id.bt_id_test, R.id.bt_get_test, R.id.bt_post_test})
    public void onViewClicked(View view) {
        switch (view.getId()) {
            case R.id.bt_id_test:
                test_id_card();
                break;
            case R.id.bt_get_test:
                test_get();
                break;
            case R.id.bt_post_test:
                test_post();
                break;
        }
    }

    private void test_post() {
        Retrofit retrofit = new Retrofit.Builder()
                .baseUrl(base_url_post)
                .addConverterFactory(GsonConverterFactory.create())
                .build();
        Method_post_service methodGetService = retrofit.create(Method_post_service.class);
        Call<Object> repos = methodGetService.trans_result("oh my god");
        showProgress();
        repos.enqueue(new Callback<Object>() {

            @Override
            public void onResponse(Call<Object> call, Response<Object> response) {
                tvResultC.setText(response.body().toString());
                closeProgress();
            }

            @Override
            public void onFailure(Call<Object> call, Throwable t) {
                tvResultC.setText("查询失败：" + String.valueOf(t));
                closeProgress();
            }

        });
    }

    private void test_id_card() {
        Retrofit retrofit = new Retrofit.Builder()
                .baseUrl(base_url_json)
                .addConverterFactory(GsonConverterFactory.create())
                .build();
        Method_id_res methodGetService = retrofit.create(Method_id_res.class);

        //把参数转换为json_object
        JSONObject configObj = new JSONObject();
        configObj.put("side", "face");
        String config_str = configObj.toString();
        HashMap<String,Object> map = new HashMap<>();
        map.put("configure", config_str);
        map.put("image", img_64);
        org.json.JSONObject jsonObject = new org.json.JSONObject(map);
        RequestBody body = RequestBody.create(okhttp3.MediaType.parse("application/json; charset=utf-8"), String.valueOf(jsonObject));

        Call<Object> repos = methodGetService.trans_result1(body);
        showProgress();
        repos.enqueue(new Callback<Object>() {

            @Override
            public void onResponse(Call<Object> call, Response<Object> response) {
                tvResultA.setText(String.valueOf(response.body()));
                closeProgress();
            }

            @Override
            public void onFailure(Call<Object> call, Throwable t) {
                tvResultA.setText("查询失败：" + String.valueOf(t));
                closeProgress();
            }

        });
    }

    private void test_get() {
        Retrofit retrofit = new Retrofit.Builder()
                .baseUrl(base_url_get)
                .addConverterFactory(GsonConverterFactory.create())
                .build();
        Method_get_service methodGetService = retrofit.create(Method_get_service.class);
        Call<Object> repos = methodGetService.listrepos("octocat");
        showProgress();
        repos.enqueue(new Callback<Object>() {

            @Override
            public void onResponse(Call<Object> call, Response<Object> response) {
                tvResultB.setText(response.body().toString());
                closeProgress();
            }

            @Override
            public void onFailure(Call<Object> call, Throwable t) {
                tvResultB.setText("查询失败：" + String.valueOf(t));
                closeProgress();
            }

        });
    }

    /**
     * get方法的接口
     */
    private interface Method_get_service {
        @GET("users/{user}/repos")
        Call<Object> listrepos(@Path("user") String user);
    }

    /**
     * post方法的接口
     */
    private interface Method_post_service {
        @POST("translate?doctype=json&jsonversion=&type=&keyfrom=&model=&mid=&imei=&vendor=&screen=&ssid=&network=&abtest=")
        @FormUrlEncoded
        Call<Object> trans_result(@Field("i") String data);
    }

    /**
     * json方法的接口
     */
    private interface Method_id_res {
        @POST("rest/160601/ocr/ocr_idcard.json")
        @Headers({"Content-type:application/json;charset=UTF-8", "Accept: application/json", "Authorization:APPCODE 8f7f28ec001b4fa987a9c252218e852b"})
        Call<Object> trans_result1(@Body RequestBody body);
    }

    private String img_64 = "";

}
